import {
  DBBrand,
  DBButton,
  DBHeader,
  DBLink,
  DBNavigation,
  DBNavigationItem,
} from "@db-ux/react-core-components"

export function Header() {
  return (
    <DBHeader
      brand={<DBBrand>DBHeader</DBBrand>}
      metaNavigation={<DBLink href="#">Imprint</DBLink>}
      primaryAction={
        <DBButton icon="magnifying_glass" variant="ghost" noText>
          Search
        </DBButton>
      }
      secondaryAction={
        <DBButton icon="x_placeholder" variant="ghost" noText>
          Profile
        </DBButton>
      }
    >
      <DBNavigation>
        <DBNavigationItem icon="x_placeholder">
          <a href="#">Link</a>
        </DBNavigationItem>
        <DBNavigationItem icon="x_placeholder" disabled>
          <a href="#">Link disabled</a>
        </DBNavigationItem>
      </DBNavigation>
    </DBHeader>
  )
}
